import { StatusBar } from 'expo-status-bar';
import Icon from 'react-native-ico-material-design';
import { StyleSheet, Text, View, Pressable } from 'react-native';

import React from 'react';

export default function App() {
  return (
    <View style={styles.container}>
      <Icon name="add" size={40} color="blue" /> {/* The "add" icon */}
      <Icon name="plus" size={40} color="green" /> {/* The "plus" icon */}
      <Icon name="queue" size={40} color="red" /> {/* The "queue" icon */}
      <Icon name="plus" size={40} color="purple" badge="10" /> {/* Plus icon with a badge */}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: 'center',
    alignItems: 'center',
  },
});
